// Get all makes that have a popcorn.webmaker.org prefix in at least one of their tags
Make( "localhost:5000" ).all
                        .withTagPrefix( "popcorn.webmaker.org" )
                        .then(function( data ) { /* handle results */ } );

// Sort results by author, ascending
Make( "localhost:5000" ).all
                        .withTags( [ "popcorn.webmaker.org" ], "and" )
                        .sortByField( "author", "asc" )
                        .then(function( data ) { /* handle results */ } );

make.create( {}, function( res ) {} );
make.update( "id", function( res ){} );
make.delete( "id", function( res ){} );
```

